  border: 1px solid black;
  display: flex;
`;

const Title = styled.h1`
  color: #2A9D8F;
  font-size: 4rem;
  border: solid;
  margin-left: 3%;
  margin-top: 3%;
`;

const Footer = styled.footer`
  border
`;

function App() {

  return (
    <div className='App'>
      <Nav>
        <img src='/imgs/trollmain.jpg'/>
      <Title>HN Trolls!</Title>
      </Nav>
      <SignIn />  
    </div>
  );
}

export default App;
